import React from "react";
import {connect} from 'react-redux';
import Button from '@material-ui/core/Button';
import calculatorActions from '../actions/calculator';
import { withStyles } from '@material-ui/core/styles';
import { bindActionCreators } from 'redux';

const StyledButton = withStyles({
    root: {
    outline: 'none',
    border: 'none',
    padding: '5%',
    width: 300,
    display: 'flex',
    marginTop: '2%',
    cursor: 'pointer',
    color: '#fff',
    fontWeight: 500,
    fontSize: '1rem',
    height: 62,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#313131',
    '&:hover': {
        backgroundColor: '#635f5f',
    },
    },
    hover: {},
  })(Button);

class Calculator extends React.Component{
    render () {
        console.log(this.props);
        return (
            <div>
                <StyledButton 
                    onClick={() => calculatorActions.fetchExpresions({
                        expressionsCount: 5,
                    })(this.props.dispatch)}>
                Get and solve expressions
                </StyledButton>
                {this.props.isLoading && (
                    <div>
                        Loading
                    </div>
                )}
                {this.props.isLoading && (
                    <div style={{display: 'flex', flexDirection: 'column'}}>
                        {this.props.list.map(expression => (
                            <div>
                                {expression.name}
                            </div>
                        ))}
                    </div>
                )}

            </div>
        )
    }
}

const mapReduxStateToProps = reduxState => ({
    ...reduxState,    
});

const mapDispatchToProps = (dispatch) => {
    const {
     fetchStudents,
    } = bindActionCreators(studentsActions, dispatch);
    return ({
      actionFetchStudents: fetchStudents,
    });
   };
   

export default connect(mapReduxStateToProps, mapDispatchToProps)(Calculator);
